			case SND_BUZZ:
			case SND_TELEPORT:
			case SND_SCRATCH_IN:
			case SND_SCRATCH_OUT:
			case SND_MENU_MUSIC:
			case SND_GAME_MUSIC:
			case SND_GAME_MUSIC2:
			case SND_GAME_MUSIC3:
				return true;
			}
		}

		public static bool isFont(int id)
		{
			switch (id)
			{
			default:
				return false;
			case FNT_BIG_FONT:
			case FNT_SMALL_FONT:
			case FNT_FONT_NUMBERS_BIG:
				return true;
			}
		}
	}
}
